import React from "react";
import "./Login.css";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "./images/icon.jpg";
function Login() {
  return (
    <>
      <div>
        <form action="" method="post">
          <img src={img1} alt="" />
        </form>
      </div>
    </>
  );
}

export default Login;
